import React, { useState } from "react";
import { Tabs, Tab } from "react-bootstrap";

import Box from "@mui/material/Box";
import PersonOutlinedIcon from "@mui/icons-material/PersonOutlined";
import CalendarTodayOutlinedIcon from "@mui/icons-material/CalendarTodayOutlined";

const themeColors = {
  primary: "#E1242A",
  secondary: "#891515",
  darkGrey: "#34373F",
  lightGrey: "#A1A4AC",
  black: "#000000",
  white: "#FFFFFF",
  background: "#EDF2F4",
};

const Topbar = () => {
  const [selected, setSelected] = useState();

  return (
    <Tabs defaultActiveKey="" id="uncontrolled-tab-example" className="mb-3">
      <Tab eventKey="home" title="Main Page" className="home">
        <h1>Home</h1>
      </Tab>
      <Tab eventKey="profile" title="Profile Page"></Tab>
      <Tab eventKey="contact" title="Status Tracker"></Tab>
    </Tabs>
  );
};

export default Topbar;
